import styled from "styled-components";
const SubTitleWapper = styled.div`
  font-size: 3rem;
  padding: 4rem;
  & > h1 {
    font-weight: 500;
    display: inline-block;
    position: relative;
    &::before {
      content: "";
      width: 100%;
      height: 20%;
      position: absolute;
      background: red;
    }
  }
`;
const SubTitle = ({ title, info }) => {
  return (
    <SubTitleWapper>
      <h1>{title}</h1>
      <p>{info}</p>
    </SubTitleWapper>
  );
};
export default SubTitle;
